// src/index.js
import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { CssBaseline } from '@mui/material';
import { BrowserRouter as Router } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext'; // Actualiza la ruta si es necesario
import { CartProvider } from './context/CartContext'; // Actualiza la ruta si es necesario

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>
    <Router>
      <AuthProvider>
        <CartProvider>
          <CssBaseline />
          <App />
        </CartProvider>
      </AuthProvider>
    </Router>
  </React.StrictMode>
);
